'use strict';
//@@DocBrief("The class for getting access to leverage profiles.")
class LeverageProfilesProvider {
    storage;
    static create(storage) {
        let instance;
        instance = new LeverageProfilesProvider();
        instance.storage = storage;
        return instance;
    }
    getPLCalculationPath(accountId, leverageProfileId, offerId) {
        return this.storage.getPLCalculationPath(accountId, leverageProfileId, offerId);
    }
}
module.exports = LeverageProfilesProvider
